import * as React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import HomeScreen from "./screens/Home";
import ConsentScreen from "./screens/Consent";
import PhraseBackUpScreen from "./screens/BackUpPhrase";
import CreateStepThreeScreen from "./screens/CreateStepThree";
import CreateStepFourScreen from "./screens/CreateStepFour";
import YourPhraseScreen from "./screens/YourPhrase";
// import SecretPhraseImport from "./screens/SecretPhraseImport";

const Stack = createNativeStackNavigator();

const App = () => {
  // @ts-ignore
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={HomeScreen}
          options={{ title: "Welcome" }}
        />
        <Stack.Screen name="Consent" component={ConsentScreen} />
        <Stack.Screen name="Your Secret Phrase" component={YourPhraseScreen} />
        <Stack.Screen
          name="Back Up Your Phrase"
          component={PhraseBackUpScreen}
        />
        <Stack.Screen
          name="CreateStepThree"
          component={CreateStepThreeScreen}
        />
        <Stack.Screen name="CreateStepFour" component={CreateStepFourScreen} />
        {/*<Stack.Screen*/}
        {/*  name="Import Your Own Secret Phrase"*/}
        {/*  component={SecretPhraseImport}*/}
        {/*/>*/}
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
